def divide_rect(rectA, rectB):
    a_x1, a_y1, a_x2, a_y2 = rectA
    b_x1, b_y1, b_x2, b_y2 = rectB

    #No interaction
    if b_x2 <= a_x1 or b_x1 >= a_x2 or b_y2 <= a_y1 or b_y1 >= a_y2:
        return [rectA], True
    
    #Rect B contains A
    if b_x1 <= a_x1 and b_y1 <= a_y1 and b_x2 >= a_x2 and b_y2 >= a_y2:
        return None, True
    
    #Rect A contains B
    if a_x1 <= b_x1 and a_y1 <= b_y1 and a_x2 >= b_x2 and a_y2 >= b_y2:
        return -1, False 

    #Rect A merge B
    if (a_y1 == b_y1 and a_y2 == b_y2 and a_x2 == b_x1) or (a_x1 == b_x1 and a_x2 == b_x2 and b_y1 == a_y2):
            return [(a_x1, a_y1, b_x2, b_y2)], False
    #Rect B merge A
    elif (a_y1 == b_y1 and a_y2 == b_y2 and a_x1 == b_x2) or (a_x1 == b_x1 and a_x2 == b_x2 and a_y1 == b_y2):
            return [(b_x1, b_y1, a_x2, a_y2)], False

    #Cut A into pieces
    pieces = []
    ##Cut left side
    if b_x1 > a_x1:
        c_x1, c_y1, c_x2, c_y2 = a_x1, a_y1, a_x2, a_y2
        c_x2 = a_x1 = b_x1
        pieces.append((c_x1, c_y1, c_x2, c_y2))
    ##Cut right side
    if b_x2 < a_x2:
        c_x1, c_y1, c_x2, c_y2 = a_x1, a_y1, a_x2, a_y2
        c_x1 = a_x2 = b_x2
        pieces.append((c_x1, c_y1, c_x2, c_y2))
    ##Cut button side
    if b_y1 > a_y1:
        c_x1, c_y1, c_x2, c_y2 = a_x1, a_y1, a_x2, a_y2
        c_y2 = a_y1 = b_y1
        pieces.append((c_x1, c_y1, c_x2, c_y2))
    ##Cut top side
    if b_y2 < a_y2:
        c_x1, c_y1, c_x2, c_y2 = a_x1, a_y1, a_x2, a_y2
        c_y1 = a_y2 = b_y2
        pieces.append((c_x1, c_y1, c_x2, c_y2))
    
    return pieces, True

