@timer
def calculate(rectangles):
    # print(rectangles)

    cutResult = []
    maxl = 0
    for rect in rectangles:
        loopResult = []
        addBack = True
        for i, eachCut in enumerate(cutResult):

            cuts, addBack = divide_rect(eachCut, rect)
            if cuts == -1:
                loopResult.extend(cutResult[i:])
                break

            if cuts:
                loopResult.extend(cuts)
        
        cutResult = loopResult
        if addBack:
            cutResult.append(rect)
        maxl = max(maxl, len(cutResult))
                    
    print(f"list max={maxl}")
                    
    area = 0
    for piece in cutResult:
        x1, y1, x2, y2 = piece
        area += ((x2-x1) * (y2-y1))

    return area
    # return maxl


